export default function CRM() {
  const stages = ['New', 'Contacted', 'Qualified'];
  const leads = [
    { name: 'Ravi Kumar', stage: 'New' },
    { name: 'Anita Joshi', stage: 'Contacted' },
    { name: 'Sunil Verma', stage: 'Qualified' },
  ];

  return (
    <div className="p-10">
      <h1 className="text-4xl font-bold mb-8 text-center">CRM Board</h1>
      <div className="grid md:grid-cols-3 gap-6">
        {stages.map(stage => (
          <div key={stage} className="bg-gray-100 p-4 rounded shadow">
            <h2 className="text-xl font-semibold mb-4">{stage}</h2>
            {leads.filter(l => l.stage === stage).map((lead, i) => (
              <div key={i} className="p-2 bg-white mb-2 rounded shadow text-sm">{lead.name}</div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
}
